import React from "react";

export default function Example(props) {
  if (props.example) {
    return (
      <div className="Example">
        <span>Example(s): </span>
        <ul>
          {props.example.map(function (example, index) {
            return <li key={index}>{example}</li>;
          })}
        </ul>
        <em>{props.example}</em>
      </div>
    );
  } else {
    return null;
  }
}
